import React from "react";
import "./Apod.scss";
import { connect } from "react-redux";
import getApodAsync from "../../Redux/Apod/apod-actions";
import PictureofTheDay from "../../Components/PictureOfTheDay/PictureOfTheDay";
import { createStructuredSelector } from "reselect";
import { selectIsApodFetching } from "../../Redux/Apod/apod-selectors";


class Apod extends React.Component {
  componentDidMount() {
    const {getApodAsync} = this.props;
    getApodAsync();
  }
  render() {
    return (
      <div className="apod">
        <PictureofTheDay />
      </div>
    );
  }
}

const mapStateToProps = createStructuredSelector({
  isFetching: selectIsApodFetching
});

const mapDispatchToProps = dispatch => ({
  getApodAsync: () => dispatch(getApodAsync())
});

export default connect(mapStateToProps, mapDispatchToProps)(Apod);
